import React from 'react';
import Navbar from './components/Navbar.jsx';
import Footer from './components/Footer.jsx';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Contact from './pages/Contact.jsx';

function Home() {
  return (
    <div className="text-center p-6">
      <h1 className="text-3xl font-bold mb-4 text-blue-900">Welcome to SAHYatri GOVERNMENT PORTAL</h1>
      <p className="text-lg text-gray-700 mb-6">
        This is the home page. Use the navigation bar to explore the portal.
      </p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App min-h-screen bg-gray-100 flex flex-col min-h-screen">
        <Navbar />
        <main className="flex-grow flex items-center justify-center h-[calc(100vh-64px)]">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
